Settings.LandingViewFormula:
LET $currentUser:= EBMS_GET_CURRENT_USER();
LET $isVendor:= EBMS_IS_USER_IN_ROLE($currentUser, "Vendor Accounts");
LET $isEveyone:= EBMS_IS_USER_IN_ROLE($currentUser, "Everyone");
LET $isSysBuilder := EBMS_IS_USER_IN_ROLE($currentUser, "System Builders");

RETURN

IF(

  	$isSysBuilder = TRUE, COALESCE($requestedView, IF( [Vendor Registered] <> TRUE, "Default", "Internal") ),

  	[Vendor Registered] <> TRUE, "Default",

  	$isEveyone = TRUE, "Internal",

  	$isVendor = TRUE, "Vendor",

  	"Default"

  )

FieldEntry.Formula:
ARRAY(
	ARRAY(
		HASH_GET($eventargs, "Parent Record"),
		HASH_MERGE(
			HASH("Change of Details Approved", TRUE),
			HASH_GET($eventargs, "Details to Change")
		)
	)
)

//$eventargs = ARRAY(businessnumbertype, businessnumber)
LET $businessNumberType := COALESCE(ARRAY_INDEX($eventargs, 1), [Business Number Type]);
LET $businessNumber := COALESCE(ARRAY_INDEX($eventargs, 2), [BusinessNumber]);

LET $format := 
DB_LOOKUP(
  "Business Number Format", 
  "Settings - Vendor", 
  "[RecordID] = 1 AND [Business Number Type] = " & DB_ENCODECONSTANT($businessNumberType)
); 

LET $formatLength := LEN(REPLACESUBSTRING(" ", $format, ""));

LET $data := $businessNumber;
LET $isNumber := ISERROR(N(REPLACESUBSTRING(" ", $businessNumber, ""))) <> TRUE;
LET $filtered := ARRAY_JOIN(SPLIT($data, " "), "");



RETURN
IF( 
  $format = NULL, 
    $data,
  $isNumber,
    NUMBERFORMAT(LEFT($filtered, $formatLength), $format),
  $data
)

